import React from 'react';

const AdminDashboard = ({ stats }) => {
  // Requirements ke hisaab se calculations 
  const totalMeetings = stats.filter(s => s.type.includes('Meeting')).length;
  const totalDistance = stats.reduce((acc, s) => acc + (s.distanceToday || 0), 0);
 // Purana code shayad ye check kar raha tha:
// const b2bSales = stats.filter(s => s.payload?.mode === 'B2B').length;

// Naya Fix: Case-insensitive check lagayein (b2b ya B2B dono chalenge)
const b2bSales = stats.filter(s => 
  s.type === 'Sale' && 
  s.payload?.mode?.toUpperCase() === 'B2B'
).length;

const b2cSales = stats.filter(s => 
  s.type === 'Sale' && 
  s.payload?.mode?.toUpperCase() === 'B2C'
).length;

  return (
    <div style={dashStyles.wrapper}>
      <h2 style={{color: '#2c3e50'}}>üõ∞Ô∏è Occamy Central Control</h2>
      
      {/* Metrics Cards  */}
      <div style={dashStyles.grid}>
        <div style={dashStyles.card}><h4>Total Distance</h4><p>{totalDistance} km</p></div>
        <div style={dashStyles.card}><h4>Meetings</h4><p>{totalMeetings}</p></div>
        <div style={dashStyles.card}><h4>B2B Sales</h4><p>{b2bSales}</p></div>
        <div style={dashStyles.card}><h4>B2C Sales</h4><p>{b2cSales}</p></div>
      </div>

      {/* Activity Table [cite: 75, 77] */}
      <div style={dashStyles.tableBox}>
        <h3>Ground Activity Log (Verifiable)</h3>
        <table style={dashStyles.table}>
          <thead>
            <tr>
              <th>Officer</th>
              <th>Type</th>
              <th>Village</th>
              <th>Location</th>
              <th>Proof</th>
            </tr>
          </thead>
          <tbody>
            {stats.map(s => (
              <tr key={s.id}>
                <td>{s.officer}</td>
                <td><strong>{s.type}</strong></td>
                <td>{s.village || 'N/A'}</td>
                <td>{s.location?.lat.toFixed(4)}, {s.location?.lng.toFixed(4)}</td>
                <td>
                  {s.photo && <a href={`http://localhost:5000${s.photo}`} target="_blank" rel="noreferrer">View Image</a>}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

const dashStyles = {
  wrapper: { padding: '20px', backgroundColor: '#f9f9f9', minHeight: '100vh' },
  grid: { display: 'flex', gap: '15px', marginBottom: '25px' },
  card: { flex: 1, padding: '20px', background: '#fff', borderRadius: '12px', boxShadow: '0 4px 6px rgba(0,0,0,0.1)', textAlign: 'center' },
  tableBox: { background: '#fff', padding: '20px', borderRadius: '12px', overflowX: 'auto' },
  table: { width: '100%', borderCollapse: 'collapse', marginTop: '10px' }
};

export default AdminDashboard;
